/**
 * 页面名_模块名_类型名
 */
const comState = {
    labelPage: (page) => {
        console.log(page, '');
        return {
            default: 0,
            type: 'handleLabelPage',
            data: {
                labelPage: Number(page)
            }
        }
    }
}

export default comState;
